import React from 'react'
import styled from 'styled-components'

const Main = styled.div`
    border-radius: 4px;
    width: 200px;
    height: 100px;    
    margin-right: 2%;
    position: relative;
`

const Title = styled.p`
    position: absolute;
    top: 0;
    left: 0;
    margin-left: 10px;
    font-weight: bold;
    color: #fff;

`

const Board = (props) => {
    return(
        <Main>
            <Title>Teste</Title>        
        </Main>
    )
}

export default Board
